import React from 'react';
import styled from 'styled-components';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const Content = () => {
  return (
    <Container>
      <Banner>
        <h3>Set 7 Update is now live on TFTactics!</h3>
        <a>Click here to learn more</a>
      </Banner>
      <Row>
        <Col lg={6}>
          <Filter>
            <h4>Filter</h4>
          </Filter>
        </Col>
        <Col>
          <TierList>
            <h4>TFT Meta Team Comps Tier List</h4>
          </TierList>
        </Col>
      </Row>
    </Container>
  );
};

export default Content;

const Container = styled.div`
  max-width: 1200px;
  width: 90%;
  margin: 0 auto;

  padding-top: 50px;
`;
const Banner = styled.a`
  height: 100px;
  background-image: url(https://rerollcdn.com/update/set-7-update-bg.png);
  cursor: pointer;

  display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
  transition: all 0.3s;
  border: 1px solid #0d202b;

  &:hover {
    border: 1px solid #227aad;

    & a {
      color: #2689c2;
    }
  }

  & h3 {
    color: rgba(255, 255, 255, 0.9);
    margin-bottom: 3px;
  }

  & a {
    color: #579dd4;
    font-size: 16px;
    font-weight: 500;
    transition: all 0.3s;
  }
`;

const Wrapper = styled.div`
  display: flex;
`;
const Filter = styled.div``;
const TierList = styled.div``;
